import React, { useState, useEffect } from 'react';
import Sidebar from './Sidebar';
import './Maintenance.css';

const API_BASE_URL = 'http://localhost:4069/society/homepage'; // Adjust the base URL as needed

const DirectoryPage = () => {
  const [admins, setAdmins] = useState([]);
  const [residents, setResidents] = useState([]);
  const [staffs, setStaffs] = useState([]);

  useEffect(() => {
    // Fetch all user data on component mount
    const fetchData = async () => {
      try {
        const adminResponse = await fetch(`${API_BASE_URL}/getadmin`);
        const adminData = await adminResponse.json();

        const residentStaffResponse = await fetch(`${API_BASE_URL}/staffs`);
        const residentStaffData = await residentStaffResponse.json();

        setAdmins(adminData);
        setResidents(residentStaffData.residents);
        setStaffs(residentStaffData.staffs);
      } catch (error) {
        console.error('Failed to fetch data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="page-container">
      <Sidebar />
      <div className="main-content">
        <h2>Directory</h2>
        <div className="directory-table">
          <h3>Admins</h3>
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>Email</th>
                <th>Contact Number</th>
              </tr>
            </thead>
            <tbody>
              {admins.map((admin) => (
                <tr key={admin._id}>
                  <td>{admin.name}</td>
                  <td>{admin.email}</td>
                  <td>{admin.contact}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
        <div className="directory-table">
          <h3>Residents</h3>
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>Email</th>
                <th>Contact Number</th>
                <th>Flat Number</th>
              </tr>
            </thead>
            <tbody>
              {residents.map((resident) => (
                <tr key={resident._id}>
                  <td>{resident.name}</td>
                  <td>{resident.email}</td>
                  <td>{resident.contact}</td>
                  <td>{resident.flat}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
        <div className="directory-table">
          <h3>Staffs</h3>
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>Email</th>
                <th>Contact Number</th>
                <th>Role</th>
              </tr>
            </thead>
            <tbody>
              {staffs.map((staff) => (
                <tr key={staff._id}>
                  <td>{staff.name}</td>
                  <td>{staff.email}</td>
                  <td>{staff.contact}</td>
                  <td>{staff.role}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default DirectoryPage;
